INSERT INTO poll_choices (poll_id, title, image, description) VALUES (2, 'Spirited Away', 'data:image/webp;base64,', 'Ten-year old Chihiro and her parents are moving when her father takes a wrong turn. Her father thinks they''ve found an abandoned amusement park and insists on exploring.');
INSERT INTO poll_choices (poll_id, title, image, description) VALUES (2, 'My Neighbour Totoro', 'data:image/webp;base64,','In 1958 Japan, university professor Tatsuo Kusakabe and his two daughters, Satsuki and Mei, move into an old house to be closer to the hospital where their mother Yasuko is recovering from a long-term illness.');
INSERT INTO poll_choices (poll_id, title, image, description) VALUES (2, 'The Tale of the Princess Kaguya', 'data:image/webp;base64,', 'A bamboo cutter named Sanuki no Miyatsuko discovers a miniature girl inside a glowing bamboo shoot.');
INSERT INTO poll_choices (poll_id, title, image, description) VALUES (2, 'Castle in the Sky', 'data:image/webp;base64,', 'An airship carrying a young girl, Sheeta and her abductor, a secret agent working for the government named Muska is attacked by the air-pirate Dola and her sons in search of Sheeta''s crystal amulet.');
INSERT INTO poll_choices (poll_id, title, image, description) VALUES (2, 'Grave of the Fireflies', 'data:image/webp;base64,','Set in the city of Kobe and Nishinomiya, Hygo Prefecture, the film tells the story of two siblings, Seita and Setsuko Yokokawa, and their desperate struggle to survive during the final months of the Second World War.');